import { getTimeDate } from "@/utils/index.js";
import UserInfo from "./userinfodialog";
import Qs from "qs"; // 1，未完善资料，2、已提交资料，待平台审核，3、审核中，4、审核通过，5、审核失败，6、正常，7、锁定，8，黑名单

export default {
  components: {
    UserInfo: UserInfo
  },
  filters: {
    statusFilter: function statusFilter(status) {
      var statusMap = {
        1: "info",
        2: "gray",
        3: "gray",
        4: "success",
        5: "danger",
        6: "success",
        7: "danger",
        8: "danger"
      };
      return statusMap[status];
    }
  },
  data: function data() {
    return {
      dialogTableVisible: false,
      selectTaskData: {},
      list: null,
      listLoading: true,
      form: {
        userStatusId: "",
        starttime: "",
        endtime: "",
        _uiName_: "eleme",
        _pagination: "{'pageNumber':1,'pageSize':10}"
      }
    };
  },
  created: function created() {},
  computed: {},
  mounted: function mounted() {
    this.fetchData();
  },
  methods: {
    formatTime: function formatTime(row, column, cellValue) {
      return getTimeDate(cellValue);
    },
    resetForm: function resetForm(formName) {
      this.form.userStatusId = "";
      this.form.starttime = this.form.endtime = "";
    },
    //获取用户列表
    fetchData: function fetchData() {
      var _this = this;

      this.listLoading = true;
      this.axios.get(this.urls.getuserlist + "?" + Qs.stringify(this.form)).then(function (response) {
        // if (response.data.errcode == 0)
        //   return this.$message.error(response.data.errmsg);
        _this.list = response.data.list;
        _this.listLoading = false;
      });
    },
    operationHandle: function operationHandle(index, row, type) {
      var param = {
        id: row.id,
        userStatusId: type
      };

      switch (type) {
        case 5:
          this.operationRemote(this.urls.editiusernfo, param); //拒绝

          break;

        case 6:
          this.operationRemote(this.urls.editiusernfo, param); //通过

          break;

        case 7:
          this.operationRemote(this.urls.editiusernfo, param); //拉黑

          break;

        case 9:
          // this.operationRemote(this.urls.ordersuccress, param); //查看资料
          break;

        case 2:
          this.operationRemote(this.urls.orderlist, param); //详情 TODO

          break;

        default:
          break;
      }
    },
    operationRemote: function operationRemote(url, param) {
      var _this2 = this;

      this.axios.put(url + "?" + Qs.stringify(param)).then(function (response) {
        _this2.fetchData();
      });
    },
    lookinfo: function lookinfo(index, row) {
      this.dialogTableVisible = true;
      this.selectTaskData = row;
    },
    editDialogListener: function editDialogListener(bol) {
      this.dialogTableVisible = bol;
    }
  }
};
